import React from 'react';
import { Container, Row, Col, Image} from 'react-bootstrap';

const Header = () => {

  return(
    <Container>
      <Row>
        <Col>NVidia</Col>
        <Col>
          <Image src="nvidia-logo.jpeg" style="height:100px; width:100px;" roundedCircle />
        </Col>
      </Row>
    </Container>
  );
}

export default Header;
